import React from 'react';
import styled from 'styled-components';

const Home = () => {
    return (
        <>
            <HomeContainer>
                <div className="container-fluid">
                    <div className="row">
                        
                    </div>
                </div>
            </HomeContainer>
        </>
    )
}

const HomeContainer = styled.div`
    background : linear-gradient(to bottom, rgba(0,0,0,0.8) , rgba(0,0,0,0.1)) , url('/images/homepage.jpg');
    background-size: cover;
    height:100vh;   
`

export default Home;
